import React from "react";
import web from "./img/img2.svg";
import Common from "./Common";
const Services = () => {
  return (
    <>
      <div className="my-4">
        <h1 className="text-center">Our Services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <dir className="row">
              <div className="col-md-4 col-10 mx-auto">
              Copy
<div classN="card" style="width: 18rem;">
  <img src="..." classN="card-img-top" alt="..."/>
  <div classN="card-body">
    <h5 classN="card-title">Card title</h5>
    <p classN="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" classN="btn btn-primary">Go somewhere</a>
  </div>
</div>
              </div>
            </dir>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
